import { DireflowComponent } from 'direflow-component';
import Button from './Button';

export default DireflowComponent.create({
  component: App,
  configuration: {
    tagname: 'lp-button',
  },
  plugins: [
    {
      name: 'font-loader',
      options: {
        google: {
          families: ['Advent Pro', 'Noto Sans JP'],
        },
      },
    },
  ],
});
